//       "review_content": "its really good product for gamers i would recommend it,Good mouse overall. Price is little high,I have been using this mouse since 2019, and I have to say, logitech built quality is second to none.I have throwed, and bashed this mouse on my table during my gaming sessions, yet this mouse still survives.Even the rubberised grips are still there. Go for it without any hesitation.For those having button issues, I have so far, replaced my left click and middle click button . I started developing these issues after 2 years . It's a simple soldering job to fix it. You can get replacement switches from tanotis. Now they work as good as new.,,So I've been using this mouse for quite a long time and believe this is the best mouse so far I've ever used. But the problem is with the cable, as another customer said the cable quality is not good the outer portion of cable from usb and from mouse side coming out and the inside wires can be visible. Even though mouse runs good but this is not good for long term usage. Other than this is pretty good mouse we have.,At close to 150g, it is ridiculously heavy for fast-paced gaming. For chill RPG titles it'll do fine, but if you wanna play something like Apex Legends on this, forget it. The shape of the mouse is super comfortable, only mouse I've owned that didn't give me any wrist pain even after 4-5 hours continuous usage. Cable quality is what you expect, like it's not even braided. Since, it's an older generation mouse, it doesn't have the double-clicking issue Logitech is infamous for.After all that, I would say in 2022, just don't buy it, it's too old to justify spending any money on.,You know and love Logitech. This is one of their best products.,I'd say this is hands down my favorite budget/gaming mouse. It's nice and comfy, works properly, and also has multiple buttons to assign them to various actions, which is not just limited to games, you can assign them to windows actions as well.Have been using this for the last 2 years and I have absolutely no complaints, although my brother thinks that it looks like a beetle :)",
