//       "review_content": "1. I have used it mainly for boiling water (knob turned maximum to right) so cannot comment much about lower temperature settings.2. It takes about 10 min for water to boil.3. Suggest Mfr to release in other colour like light blue etc (as I see some other kettles) .  It may add to the looks and give a warm feeling in the room.4. The stainless steel looks shiny but the material is not very thick but it's ok for the price.  There may be formation of scaling or white brownish spots on the base of kettle in a C shape due to the C shaped half coil at base (funny design, maybe a product created by modifying a higher wattage full circular coil kettle).  The scales are more when tap water is used due to higher presence of salts maybe.  They seem to get cleaned by usual scrubbing.5. Given wide based cylinder shape, it is very easy to clean.To be aware: The kettle does not auto-shut off when water boils.  Similarly, the kettle temperature will be kept warm at knob setting unless the knob is at the leftmost when it shuts off.  Else the water will keep drying out until it dries out completely and then the kettle is supposed to auto shut off to prevent dry heating (I haven't tested this though).  These are mentioned in the manual.  So this can be thought of as a warmer + boiler.  So you CANNOT leave the kettle unattended thinking that it will auto shut off like other kettles when the water has started to boil.  I assume this is designed this way to allow a bit of cooking for those who want to use it in that manner.Accessories: Cannot fathom what the use is of the plastic bowl provided.  Given that plastics can leach chemicals when heated, I would not suggest to use it inside the kettle in any way, e.g. steaming.  A steel rack is given, too.  That could be used alongwith some steel plate with holes for steam cooking but there is none provided with the product itself.Final verdict: If you are ok with a somewhat slower heating kettle but with more versatility and easy to clean at a reasonable price, this will do the job.  If a similar product was available with higher wattage at a higher price, I would have bought that instead.,I wanted to give 1 star rating because Agaro forces its customers to give rating and review to get the warranty. It is a bad practice. You cannot force customer to give rating. As I mentioned, it may result in the product having negative rating on Amazon despite being a good product.In my opinion the product itself is good. It heats water very fast. It is good for making Maggie, pasta, and boiling eggs. But need to be careful while making Maggie or pasta because once they get dry they start to stick to the bottom.The kettle is very easy to clean.The cord length should have been longer.One issue that I noticed that only one half of the base of kettle generates heat.,Everything is good & it has been very useful for me. There is only one drawback; I guess the heating is not uniform across the base of the kettle since whenever I boil milk or make tea/coffee, a portion of one side bunrs the milk. Even while boiling water I can see the similar symptom.,Agaro Multicooker is good and gives a variety of cooking/ boiling options like Milk, Tea, Eggs, Maggi, etc.Only negative point is that Agaro team promises extended warranty of 6 months by giving asking to give a positive review on Amazon but fails to deliver on their promise and does not give any extended warranty.,Delivery has safe got item safely.Delivery on time, instantaneous water boiling sufficient space big volume best for hostel students.Hope for warranty and company response.,I liked how fast it does the work but i hate about the dirt it gets inside after cooking something, it sticks their,Overall gorgeous product. The most beautiful thing is that the cord length is big. That is a better option for your kitchen and aslo that is the best option for hostel users.üòÖ,Liked the design and operation. However cord length could be longer. Temperature control is good but knob need some modifications. Overall happy with this product.",
