//       "review_content": "Great quality overall in this price range.Bass is very low but not so low that it will feel bad.More of a balanced sound.If you use any app to improve audio such as wavelet it will almost feel like premium quality.Some points to to note:Mic is available in both the buds but will work in only 1 bud at a time. Whichever bud you will pull from the box that only will work.But if you use only 1 bud then any one of it will work  because any one of them can be used as master.You can use only one (any one of them) at a time and you can use it's mic for call, touch controls to receive or cut calls. Or else play/pause music.But this dynamic use of mic have some bug. Sometimes this change won't happens properly and mic will not work or the other bud which is inside box may have active mic started so the person you are talking to will complain about voice is not coming. Or some time may be muffled audio.Put both buds inside box and then take out again to reset it and it will work again properly.1 time I faced error that even after putting both buds inside didn't make them off and they continued connected to mobile.I connected box to charger and the issue resolved.You can put 1 bud inside ear and other hold in hand and keep close to mouth to get superior mic quality even in streets where a lot of noise is or in the office where you need to speak in very low voice.Battery backup is almost same as claimed. You can watch movies, call for ling period and listen to song whole day without the need to charge the box.If you put buds inside box inbetween for few minutes then you can really use it for a day or 2 easily.,Overall the pods are good .I don't know this piece is damaged or my system is lagging, sound delay happens at any random.But this sounds good , good product.Worth it ‚ú®,Product giod for music or vedio but bad for calling,not good as expected,, after few days,left side earbud not working..,looking good but not working good....,I have had Boult's wired earphones before and I loved them. But this is just way off the mark. The case is flimsy. It may look sturdy but it is light as a feather.The earphones themselves don't connect unless you take them out of the case. And even when they do, there is pretty loud voice announcing it. For someone like me who doesn't put the volume up too high, that voice is really irritating.Also I have noticed that the audio cuts out sometimes. I have no idea whether that's a connectivity issue or something else.In conclusion, just go for something else. This was a bad one by Boult.,Nice product üëç,I am not sure what to say! It's good for music but not useful for use for calls extremely non useful if you will speak anything the person other side  hear anything,",
