//       "review_content": "Super product,Worst product,Too good product,Good,Since long I was waiting for someone to manufacture a simple mobile set of pocket radio size so that I could listen online stations with reasonable sound quality.  As we know  what ever qualities a modern mobile set may have, the audio produced by it is always dry with no bass content.  So either we have to connect it to a music system or have to use headphones which are harmful to ears in the long run. Recently when I was surfing internet I saw this product which looked like an old radio.  On verifying the details I found this fulfills my requirement and without delay I placed order.Zebronics Astra 10 is having excellent audio quality with sufficient bass and treble content  just  like radios of olden days. The hollow space around the speaker adds to the bass  effect.  If we rotate the set and make the speaker to face us, the sound becomes more crisp.  Even with full volume  sound does not distort.Bluetooth connectivity also is marvelous  and connects within no time and there are no breaks and delay in audio transmission.  Battery backup also appears to be good.  After fully charging once I am using it daily and after 3 days still it is showing 80% charge.  Though there is no provision to know the remaining charge in the product, the mobile from which we are connecting bluetooth  shows the details.Normally we can not expect much from FM Radio in such type of gadgets. But this product is exception for that.  By attaching a small wire to the whip antenna I could listen FM station situated 200 KM away as if was local one.Aux, USB and mSD card facilities also work well.But I felt the on/off switch should have been some what sturdy.  Long press type button would have been a better option. Also scanning of FM stations  should have been on long press instead of single press to avoid accidental scanning.Over all it is a great product.To give it a nostalgic look while enjoying online radio,  I used the picture of our old National Ekco Radio's tuning dial as the home screen of the mobile.I use this for personl TV audio listening as well.Chidambar KakathkarMangalore,Poor sound quality,Worthy,You cant use it if the mobile is slim or more petite. I bought this for my mom; her mobile is a slim model and doesn't have a case, and the mobile keeps falling if you tilt it. Overall it is a good product.",
