//       "review_content": "Once you start using a bagless vacuum cleaner, you will never turn back (using it on a weekly basis since Nov 2021, so its a long tern review). Coming from another vacuum cleaner that had bags, this one is truly a hassle-free cleaner, at least you are away from the hassle of maintaining/cleaning/replacing bags which is truly a mess, and you would understand only if you have used cleaners with bags. Further, devices with bags tend to get chocked now and then, leading to less suction.‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢üéÅ INSIDE BOX‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢1. Vacuum cleaner unit2. Flexible pipe with integrated retraceable brush and suction adjustment knob3. Turbo brush nozzle4. Multi-clean nozzle5. High suction flat inlet nozzle6. Telescopic extension pipe7. User manual8. Warranty cardThe power cord is ~6mtr and device comes with a mechanish to retrace it back into the machine. It has normal 16 amp 2 pin top which can easily fit in 3 or 5-pin sockets (both 5/6 amp or 15/16amp), but better to connect it to 15/16 amp ones only considering its power consumption.‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚ûï OBSERVATIONS & PROS‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢1. Device has high suction power and can be cleaned easily with a bagless design where dust collects in a chamber, and you can empty it in the dustbin‚Äîno hassles of cleaning and replacing bags.2. Components are high quality, such as the telescopic extension is metallic, though it's also a con for this attachment. Even plastic components are of good quality.3. Device easily moves around owing to its big and smooth wheels. You don't need to pull it by force.4. Default flexible pipe itself is long and has an integrated brush that can also be retracted. Its a highly useful attachment considering it's attached to a primary flexible pipe and is easily available for use.5. Each attachment here is multipurpose. When you open the package, you feel like very few attachments are provided, but when you start exploring, you discover that all attachments are multipurpose. (details below)6. Attachments are easy snap fit and remove (ActiveLock in the company's terminology). Once you insert the attachments, it click locks and can be removed by a press of a button or release lever.7. Both the turbo brush and multi-nozzle have flexible neck and wheels on the bottom for easy movement and effective cleaning8. Dust collector can be opened with one press and has removable filters attached to it. These filters can be washed once in a while to prevent clogging.9. the Main unit has H13 filter system to filter fine dust, dust mites, etc., and is equivalent to HEPA 13, as per the company. This filter is accessible from the backside for cleaning purposes.10. Device obviously makes sound but is not in the range of causing irritation to the ears. It's in the bearable range.‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚ûñ OBSERVATIONS & CONS‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢1. Telescopic extension is metallic and heavy. So, it's a bit of trouble to use for longer durations, especially when you are trying to clean ceilings.2. Reduction of suction power is via a bypass valve built into the flexible pipe and has no way to reduce the power of the machine to reduce suction. So effectively, this valve makes cleaner suck in air from in between to reduce suction at the end, but then consumes the same amount of power. If there had been a control mechanism to reduce power, it would also save electricity.3. Device comes with a 16amp top but its 2-pin, so if you are going to use it with modular power sockets with self closing mechanism for holes, it will be a trouble to plug it in everytime.4. I miss the blower system in this cleaner, which is handy at times (was there in my previous cleaner). They could have easily implemented it.For the cons reducing 1 star, but its definitely a 4-star device.‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢üîß Attachments‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢- Flexbile pipe comes with an integrated brush, and you can easily retract it back onto the pipe- Multipurpose nozzle has a button to increase its suction power, and with one press, it goes nearer to the floor- Turbo brush nozzle sweeps the floor or mattress with rotating bristles along the length, and if you want to turn off the rotation of the brush, there is a button to lock it- Main unit has a system on the back and botton side to attach the multi-clean and turbo brush nozzle primarily for easy sweep or for storage purposes‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢üèÜ FINAL VERDICT‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢‚Ä¢This bagless vacuum cleaner is a hassle-free device and requires very less maintenance but it comes at a cost, and if you are willing to stretch your budget, it's definitely worth it. I have had no any issues so far in the past 1 year, when using it regularly.,This is a nice bag less vaccum cleaner with a rotating brush that does a great job of cleaning. It also comes with good set of accessories. I found it also cheaper to order it online compared to the ‚ÄòCroma‚Äô store. Two drawbacks (not a deal breaker) I found and I hope Philips addresses them were,1. It comes with a two pin 15 ampere plug and you need to buy an adapter to use with normal 5 ampere plugs in the house. I was afraid to use the adapter thinking that it may heat with the use but had no issues with heating of the adapter or the plugs in the wall during 15-20 minutes of cleaning each room in the house. I do not see a point in having that plug.2. During the use one just pulls it along but It has no handle to lift the machine. I believe that one can use the handle of the dust canister to lift the machine but I am afraid that repeated lifting like this will break the click-on mechanism so ended up lifting the machine as a whole all the time while moving the machine without the hose.As I mentioned earlier these are not deal breaker but enough to take one star off and can have the star back if Philips addresses the issues on this great little machine.,Suction power is good suitable for cleaning carpet , window curtains ,floors and carpets.Cleaning the dust container is also very easy. Only concern i have is, if some length power cord is not pulled out from machine, the power wire that still reamins inside the machine is getting heat from suction motor, after using the machine for nearly 1 hour and i pulled out the cord that was in the machine, it was actually liitle hot to touch not sure is it safe for the live power cord to warm up like this. would have been even better, if this had blower functionality also.,Good product,Cord length and Suction power is satisfactory,Good quality, heavy noise,This is the first vacuum cleaner purchase for me and I can say that I am a happy customer. I bought this back in August '22 and it is serving me well. It comes with attachments that are convenient and reach high places, it has three modes of cleaning (tiled floors, carpets and sofas) and with pets in the house it has made my life that much easier. Thank you Phillips for a good product and thank you Amazon for a smooth transaction.,Well-built, top-notch quality, suction power is too high.",
