//       "review_content": "I have been using this mouse for like 2 months and this is the best mouse under 500.the mouse has the basic gaming stuff like extra buttons dpi settings, but the main thing is the software like you can customize so much on this mouse the RGB is fully customizable, you can set many macros you can revamp the keys and also change the dpi values. these features usually come in expensive gamming mouses, but this is very good for this cheap.the design is also very good and one thing you should note before buying is that this mouse is big like it is big as my hand so if you got small hands, you should think twice, but it doesn't affect that much i got the hang of it in like a week.it doesn't come with any warranty so thats a con. but a part of it, everything is so good.Really would recommend,this mouse is very good for gaming, the high dpi sensor on this mouse is very good. their is no drifting. the rgb is very goodi have used this mouse for about 3 months and its still intact, no problem with scroll wheel or side button,the software provided by redgear is also very great and has lots of features.i mostly used this mouse for fps games like (csgo, valorant, overwatch)but the side buttons also help in building in fortniteonly issue is the build quality, some party feel kinda lose,its my first gaming mouse but damn its so good. the grip is perfect and dpi is also good at this range you shoud go for it if you get it under rupees 500.,No words. Just excellent. Accuracy top notch. Feeling while in hande is awesome. Feels very big in hand. Very comfortable to hold for long time. Design is very good.,nice mouse love it... decent mouse with ecent price..,If you are buying this mouse exclusively for gaming, don't cause the polling rate is no different than lets say a cheap dell mouse you see at work (exact polling rate of this mouse is 125hz which is very low if you want precise aiming in competitive). But the redeeming feature might be the looks. The rgb looks cool (but you cant use just one single color). It feels great in hand but my thumb has to pull back a lot to press the lower side button but that can be attributed to my long thumb. The cables braided too so there's that!Verdict: Great value is you can get it for around Rs. 400 considering its looks and other subtle features.,,A fine mouse for what it's worth.",
